import React, { FC } from 'react';
import styles from './index.module.less';

interface IProps {
  informations: string[]
}

const BoldenInformaion: FC<IProps> = (props: IProps) => {
  return (
    <div className={styles['info-container']}>
      {
        props.informations.map(info => {
          return <span className={styles['info']}>{info}</span>
        })
      }
    </div>
  );
};

export default BoldenInformaion;
